import './App.css';
import {Route, Routes, BrowserRouter} from "react-router-dom";
import {PageNotFound, Test} from "./pages";

function App() {
  return (
      <BrowserRouter>
            {/*<Routes>*/}
              <Route path="/test" element={Test} />
              <Route path="*" element={PageNotFound} />


            {/*</Routes>*/}
      </BrowserRouter>

  );
}

export default App;
